tputs":[{"internalType":"uint256","name":"","type":"uint256"}],"stateMutability":"view","type":"function"},{"inputs":[],"name":"getSummary","outputs":[{"internalType":"uint256","name":"","type":"uint256"},{"internalType":"uint256","name":"","type":"uint256"},{"internalType":"uint256","name":"","type":"uint256"},{"internalType":"uint256","name":"","type":"uint256"},{"internalType":"address","name":"","type":"address"},{"internalType":"string","name":"","type":"string"},{"internalType":"string","name":"","type":"string"},{"internalType":"string","name":"","type":"string"}],"stateMutability":"view","type":"function"},{"inputs":[],"name":"manager","outputs":[{"internalType":"address","name":"","type":"address"}],"stateMutability":"view","type":"function"},{"inputs":[],"name":"minimumContribution","outputs":[{"internalType":"uint256","name":"","type":"uint256"}],"stateMutability":"view","type":"function"},{"inputs":[{"internalType":"uint256","name":"","type":"uint256"}],"name":"requests","outputs":[{"internalType":"string","name":"description","type":"string"},{"internalType":"uint256","name":"value","type":"uint256"},{"internalType":"address payable","name":"recipient","type":"address"},{"internalType":"bool","name":"complete","type":"bool"},{"internalType":"uint256","name":"approvalsCount","type":"uint256"}],"stateMutability":"view","type":"function"}],"devdoc":{"kind":"dev","methods":{},"version":1},"userdoc":{"kind":"user","methods":{},"version":1}},"settings":{"compilationTarget":{"Campaign.sol":"Campaign"},"evmVersion":"london","libraries":{},"metadata":{"bytecodeHash":"ipfs","useLiteralContent":true},"optimizer":{"enabled":false,"runs":200},"remappings":[]},"sources":{"Campaign.sol":{"content":"pragma solidity ^0.8.7;

contract CampaignFactory{
    address[] public deployedCampaigns;


    function createCampaign(uint _minimum, string memory _campaignName, string memory _campaignDescription, string memory _campaignImage) public {

       Campaign newCampaign = new Campaign(_minimum, msg.sender, _campaignName, _campaignDescription, _campaignImage );
       deployedCampaigns.push(address(newCampaign)); 

    }

    function getDeployedCampaigns() public view returns ( address[] memory) {
        return deployedCampaigns;
    }

}


contract Campaign {

    struct Request {
        string description;
        uint value;
        address payable recipient;
        bool complete;
        uint approvalsCount;
        mapping(address => bool) approvals;

    }

    modifier restricted() {
        require(msg.sender == manager,"You are not the manager of this contract");
        _;
    }


    address public manager;
    uint public minimumContribution;
    string public campaignName;
    string public campaignDescription;
    string public campaignImage;
    mapping(address => bool) public approvers ;
    uint numRequests;
    mapping (uint => Request) public requests;
    uint public approversCount;

    constructor(uint _minimum, address _creator,string memory _campaignName, string memory _campaignDescription, string memory _campaignImage )  {
        manager = _creator;
        minimumContribution = _minimum;
        campaignName = _campaignName;
        campaignDescription = _campaignDescription;
        campaignImage = _campaignImage;
    }

    function contribute() public payable {
        require(msg.value >= minimumContribution, "Contribution is too low");
        approvers[msg.sender] = true;
        approversCount++;
    }

    function createRequest(string memory  _description, uint  _value, address payable  _recipient)  public  restricted {
       Request storage newRequest = requests[numRequests++];
                newRequest.description = _description;
                newRequest.value = _value;
                newRequest.recipient = _recipient;
                newRequest.complete = false;
                newRequest.approvalsCount = 0;
    }

    function approveRequest(uint _index) public {

        Request storage request = requests[_index];

        require(approvers[msg.sender],"You are not the approvers");
        require(!request.approvals[msg.sender],"You already approve it");

        request.approvals[msg.sender] = true;
        request.approvalsCount++;
    }

    function finalizeRequest(uint _index) public restricted {

        Request storage request = requests[_index];

        require(request.approvalsCount > (approversCount/2),"Less than 50% of contributors approve this");
        require(!request.complete,"Request already complete");

        request.recipient.transfer(request.value);
        request.complete = true;
    }

    function getSummary() public view returns (uint,uint,uint,uint, address,string memory,string memory,string memory) {
        return (
            minimumContribution,
            address(this).balance,
            numRequests,
            approversCount,
            manager,
            campaignName,
            campaignDescription,
            campaignImage
        );
    }

    function getRequestsCount() public view returns (uint) {
        return numRequests;
    }

}","keccak256":"0x791dbabc638b7f9cf7a27651b6625c95bbe9ce713e027dac4b966ed38060d151"}},"version":1}
